import React, { Component } from 'react'

const CarouselContainer = styled.div`
  display: flex;
  margin: 0 0 20px 20px;
`
const Wrapper = styled.div`
  width: 100%;
  overflow: hidden;
`

class Carousel extends Component {
    render() {
        const { title, children } = this.props

        return (
            <>
            <h2>{ title }</h2>
            {children}
            </>
        )
    }
}

export default Carousel
